import CircleImage from '../circleImage/CircleImage'

const Card = (props) => {
  const logoContainer =  <CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/>
  return (
    <div className='rightTimelineCard'>
      {props.side == 'left' ? 
      <>
        <p>left</p>
        logoContainer
      </>
      :
      <>
        <CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/>
        <p>right</p>
      </>
      }
    </div>
  )
}

export default Card;
